import React from "react";
import "./MainContainer.css";
import TaskBox from "../reusables/cards/TaskBox";

const MainContainer = () => {
  return (
    <div>
      <div></div>
      <div className="task-box-area">
        <TaskBox heading="Pending" bgcolor="grey" />
        <TaskBox heading="In Progress" bgcolor="#F2B32B" />
        <TaskBox heading="Completed" bgcolor="green" />
        <TaskBox heading="Deployed" bgcolor="purple" />
        <TaskBox heading="Deffered" bgcolor="red" />
      </div>
    </div>
  );
};

export default MainContainer;
